  async function execute(screenshotBuffer) {
    const rgbBuffer = await sharp(screenshotBuffer)
      .removeAlpha()
      .png()
      .toBuffer();
    let screenshotBase64 = rgbBuffer.toString("base64");

    const response = await fetch(UI_GROUNDING_MODEL_BASE_URL, {
      method: "POST",
      body: JSON.stringify({
        image: `data:image/png;base64,${screenshotBase64}`,
        box_threshold: 0.05,
        iou_threshold: 0.1,
        use_paddleocr: false,
        imgsz: 640,
      }),
      headers: { "Content-Type": "application/json" },
    });

    if (!response.ok) throw new Error("Error in parsing");
    const data = await response.json();
    const { parsed_elements: parsedElements } = data;
    return generateUiElementsList(parsedElements);

    // return mockResponse();
  }

  function generateUiElementsList(parsedElements) {
    parsedElements = Object.entries(parsedElements);

    return parsedElements
      .map(([id, element]) => {
        let { type, bounds, content, interactivity } = element;
        const boundsString = bounds.match(/\[\d+,\d+\]/g);
        bounds = boundsString.map((str) => JSON.parse(str));
        const [boundStart, boundEnd] = bounds;
        const x = (boundStart[0] + boundEnd[0]) / 2;
        const y = (boundStart[1] + boundEnd[1]) / 2;
        const coordinates = [x, y];

        return `ID: "${id}", Type: "${type?.trim()}", Content: "${content?.trim()}", Coordinates: ${JSON.stringify(
          coordinates
        )}`;
      })
      .join("\n");
  }

